import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {

    const closeHiddenMenu = (event) => {
        event.target.parentElement.style.left = "-60%";
    }

    return (
        <nav class="navbar navbar-expand navbar-dark bg-secondary">
            <a class="navbar-brand" href="https://www.google.com" target="_blank" rel="noreferrer">Redux</a>

            <ul class="navbar-nav">
                    <li><a class="nav-link" href="#">matn1</a></li>
                    <li><a class="nav-link" href="#">matn2</a></li>
                    <li class="nav-item dropdown">
                            <a class="nav-link dropdown-toggle" href="#"  data-bs-toggle="dropdown"
                            id="ide-btn">
                                    matne btn
                            </a>
                            <ul class="dropdown-menu" aria-labelledby="ide-btn">
                                    <li><a class="dropdown-item" href="#">matn1</a></li>
                                    <li><a class="dropdown-item" href="#">matn2</a></li>
                                    <li><hr class="dropdown-divider" /></li>
                                    <li><a class="dropdown-item" href="#">matn3</a></li>
                            </ul>
                    </li>
            </ul>
        </nav>
    );
}

export default Navbar;
